INSERT INTO `events` VALUES (1,'متلب','محاسبه‌ی ایده‌ها، با ماتریس‌ها','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۵۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','به جرأت می‌توان گفت که متلب، مهمترین نرم افزار در پژوهش‌های علمی و شبیه‌سازی‌های پیشرفته بخصوص در رشته‌های فنی مهندسی به شمار می‌رود. کاربرد این نرم‌افزار به قدری گسترده است که از محاسبات ساده‌ی ریاضی گرفته تا پیاده‌سازی الگوریتم‌های مختلف و پردازش سیگنال‌ها و تصاویر بسیار پیچیده را شامل می‌شود. در دوره آموزش مقدماتی، ابتدا با محیط کار متلب و نحوه‌ی نوشتن M-File و قوانین مربوط به استفاده از آن آشنا شده، در ادامه به محاسبات ماتریسی و توابع مربوط به ماتریس‌ها در متلب، نحوه‌ی کاربری عملگرهای منطقی و رابطه‌ای، کنترل روند برنامه و مصور سازی داده‌ها می‌پردازیم، و در پایان با رابط گرافیکی کاربر (GUI) و مدل‌سازی سیستم‌ها در محیط Simulink آشنا می‌شوید. از آنجا که تسلط بر نرم افزار متلب برای فعالان رشته های فنی و مهندسی ، ضروری است ، شرکت در این دوره برای دانشجویان و شاغلین این رشته ها توصیه می‌شود. همچنین افرادی که قصد طراحی سیستم و شبیه‌سازی آن را دارند، می توانند با این دوره کار خود را شروع کنند .','2014-08-03 13:11:00','سایت','Class',35,500000,'MATLAB-logo.jpg','image/jpeg',25147,'2014-06-07 13:12:21','2014-06-07 13:12:21','2014-08-02 17:11:43'),(2,'جاوااسکریپت','طراحی سایت، مستقل از زمان','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۵۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','برنامه‌های تحت وب، به‌طور پیوسته در حال پیشرفت هستند. در سال‌های اخیر نیز گسترش این برنامه‌ها در داخل ایران به‌وضوح قابل مشاهده‌ است. داشتن یک رابط کاربری جذاب و هم‌چنین یک ساختار قوی و سریع در سمت سرور، از مهم‌ترین نکات در بحث برنامه‌نویسی وب است. جاوااسکریپت با استفاده از کتاب‌خانه‌های قدرتمند و سیستم آسنکرون، جایگاه خود را در این حیطه به‌دست آورده و طبق آماری که از سایت http://redmonk.com/ گرفته‌شده در حال حاضر بیشترین کد‌های موجود در سایت گیت‌هاب با زبان جاوااسکریپت نوشته شده‌اند. در کلاس «آموزش جاوا اسکریپت» مباحثی چون آشنایی با خود زبان و شیوه‌های برنامه‌نویسی (تابعی و شی‌گرا) تا استفاده از ساختار MVC و آشنایی با چند کتاب‌خانه‌ی کاربردی جاوااسکریپت از جمله backbone.js، پوشش داده می‌شود. این کلاس با توجه به آموزش ساختاری زبان جاوااسکریپت، به‌تمامی افرادی که علاقه‌مند به طراحی وب (چه در سمت کاربر و چه در سمت سرور) توصیه می‌شود.','2014-08-03 13:13:00','سایت','Class',50,500000,'javascript_logo_unofficial-300x300.png','image/png',73770,'2014-06-07 13:23:49','2014-06-07 13:23:49','2014-08-02 17:12:05'),(3,'دروپال','مدیریت محتوا با جامعه‌ی کاربر و توسعه‌دهنده‌ی بزرگ','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۵۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','با گسترش همگانی اینترنت، سازمان‌ها و مشاغل مختلف برای معرفی خود و خدماتی که ارائه می‌دهند نیاز به وب‌سایت دارند تا این اهداف را برآورده سازد. عموما این گونه سایت‌ها شبیه به هم هستند و قسمت‌های مشترک زیادی دارند، مثلا اعلام خبر، بخش ارتباط، عضویت و... هم‌چنین نیاز‌هایی نیز به صورت اختصاصی تعریف شود. دروپال چارچوبی است برای مدیریت محتوا، با قابلیت اضافه‌ شدن ماژول‌های مختلف برای نیاز‌های خاص. آموزش دروپال از دو قسمت «راه‌اندازی یک سایت مبتنی بر محتوا با استفاده از این چارچوب» و «نوشتن ماژول‌ خاص برای این چارچوب» تشکیل می‌شود. برای نمونه سایت دانشکده‌ی مهندسی برق و کامپیوتر از این چارچوب استفاده می‌کند و در حال حاضر دانشکده به‌دنبال گسترش این سایت است. در حال حاضر ۲.۱ درصد تمام وب‌سایت‌های دنیا با این چارچوب نوشته شده‌اند. با توجه به کاربرد بسیار گسترده‌ و سرعت بالای این چارچوب برای راه‌اندازی سایت‌های مبتنی بر محتوا، یادگیری دروپال می‌تواند ابزار قدرتمندی برای هر کس به وجود بیاورد.','2014-08-03 13:24:00','سایت','Class',25,500000,'druplicon.large_.png','image/png',25329,'2014-06-07 13:28:53','2014-06-07 13:28:53','2014-08-02 17:12:10'),(4,'پایتون','قدرتمند، سطح بالا، منعطف','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۵۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','پایتون یک زبان اسکریپتی سطح بالا است که کاربرد آن دامنه‌ی وسیعی را در بر می‌گیرد (از تحقیق‌های علمی، محاسبات ریاضی و شبیه‌سازی‌ها تا چارچوب‌های اینترنت و گرافیک کامپیوتری). در کلاس «آموزش پایتون»، از آموزش گرامر و ساختار این زبان و تکنیک‌های برنامه‌نویسی تا آشنایی با کتاب‌خانه‌ها و استفاده از آن‌ها و آشنایی با چارچوبdjango  پوشش داده می‌شود. یادگیری زبان پایتون با توجه به کتاب‌خانه‌های متنوع و سطح بالا و اسکریپتی‌بودنش، در هر مقطعی می‌تواند کمک بزرگی محسوب شود.','2014-08-03 13:28:00','سایت','Class',35,500000,'300px-Python-logo-notext.svg.png','image/png',13229,'2014-06-07 13:39:27','2014-06-07 13:39:27','2014-08-02 17:12:51'),(5,'آمادگی برای مسابقات ای‌سی‌ام','سه نفر، یک کامپیوتر و... الگوریتم','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۲۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۳۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','مسابقات ACM ICPC یکی از مهم‌ترین مسابقات برنامه‌نویسی در دنیا است. در این مسابقه، تیم‌های سه نفره با استفاده از تنها یک کامپیوتر در زمان ۵ ساعت، سوال‌های الگوریتمی و برنامه‌نویسی را حل می‌کنند. پایه‌ی این مسابقات بر اساس الگوریتم است. این مسابقات در اواخر پاییز به‌صورت منطقه‌ای در دانشگاه شریف برگزار می‌شود و برگزیدگان آن به مسابقات جهانی می‌روند. هر دانشگاه در این مسابقات سهمیه‌ی محدود دارد که هر سال با توجه به وضعیت سال گذشته‌ی آن دانشگاه تعیین می‌شود. در کلاس «آمادگی برای مسابقاتACM ICPC»، ساختار‌داده‌های مختلف و پرکاربرد، الگوریتم‌ها و حوزه‌های مختلف مثل گراف، هندسه‌ی محاسباتی، برنامه‌نویسی پویا و... مورد بحث قرار می‌گیرند. هم‌چنین تکنیک‌های برنامه‌نویسی سرعتی مثل ماکرو‌ها، عبارت منظم و... آموزش داده‌ می‌شود. با توجه به این‌که مباحث این کلاس در دروس «ساختمان داده» و «طراحی الگوریتم» کاربرد دارد، شرکت در آن به تمامی دانشجویان ورودی ۹۲ پیشنهاد می‌شود. هم‌چنین هر هفته مسابقه‌ی هفتگی مرتبط با کلاس برگزار می‌شود و شرکت در این مسابقات در انتخاب تیم‌‌های منتخب دانشگاه تاثیر دارد.','2014-07-12 04:39:00','سایت','Class',45,350000,'ACM-Logo1.jpg','image/jpeg',242104,'2014-06-07 13:40:59','2014-06-07 13:41:00','2014-08-14 08:48:40'),(6,'نظریه‌ی بازی‌ها','بازی با ذهن زیبا','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۲۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n\r\n','تقریبا هر لحظه‌ای از زندگی شما، یک بازی است. تمرین یک درس را تحویل بدهم یا نه؟ تقلب کنم یا نه؟ در فوتبال و ضربه‌ی پنالتی به سمت چپ شوت کنم یا سمت راست؟ به عنوان دروازه‌بان به سمت چپ بپرم یا راست؟ زمانی که با دوستم می‌خواهم به سینما بروم به فیلم مورد علاقه‌ی خودم بروم یا فیلم مورد علاقه‌ی وی؟ اگر صدای جیغی در خیابان به گوش برسد به پلیس زنگ بزنم یا نزنم؟ تمامی این موقعیت‌ها یک بازی هستند و شما بازیکنی هستید که باید استراتژی خود را انتخاب کنید تا در مبارزه با دیگران به بیش‌ترین سود برسید. در حلقه‌ی نظریه‌ی بازی‌ها مقدمه‌ای از این مبحث را بیان می‌کنیم و در رابطه با کاربرد‌های آن در علوم کامپیوتر و هم‌چنین اقتصاد بحث می‌کنیم.','2014-08-24 07:30:00','سایت','Ring',15,150000,'GameTheory.jpg','image/jpeg',119534,'2014-06-09 02:59:32','2014-06-07 15:01:09','2014-08-15 19:00:29'),(7,'Gamification','I want to play a game...','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۲۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n\r\n<p>\r\nدر جلسه‌ی سوم این حلقه، مقالات مرتبط با این مبحث که توسط شرکت‌کنندگان مطالعه شده‌است مورد بررسی قرار می‌گیرد. زمان آن نیز در پایان جلسه‌ی دوم تعیین می‌شود\r\n</p>','<p>آیا حاضر هستید به یک غریبه بگویید که هر روز کجا و با چه کسانی رفت‌و‌آمد می‌کنید؟ آیا حاضر هستید در شرکت‌تان روزی دو ساعت بیش‌تر کار کنید بدون این‌که پول بیش‌تری بگیرید؟ آیا حاضر هستید در ایستگاه مترو از پله استفاده کنید، حتی اگر پله‌برقی خلوت باشد؟ آیا حاضر هستید زباله‌های کنار یک سطل زباله را بلند کنید و داخل سطل بیاندازید؟ مبحث جدیدی به‌نام Gamification وجود دارد که باعث می‌شود آدم‌ها حاضر باشند تمام کارهایی که گفته‌شد را انجام دهند. در این حلقه مقدمه، مثال‌ها و جنبه‌های مختلف Gamification را بررسی می‌کنیم. مثال‌های این مبحث را می‌توانید در فیس‌بوک، TheFunTheory ،Nike+ ،Foursquare و... ببینید.</p>\r\n','2014-08-03 02:40:00','سایت','Ring',15,150000,'game-of-thrones-poster_85627-1920x1200.jpg','image/jpeg',223284,'2014-06-09 02:45:45','2014-06-09 02:45:46','2014-08-02 17:13:52'),(8,'ویراستاری','به زبان آدمیزاد','<br>\r\n<p>\r\n<strong>\r\nزمان جلسات، بعد از پایان ثبت‌نام با مشورت شرکت‌کنندگان تعیین می‌شود.\r\n</strong>\r\n<p>','آدمیزاد ناگهان ترمز احساسات طبیعی‌اش را کشید و در انتخاب کلمات و عبارات احتیاط کرد تا دسته‌گلی به آب ندهد. اما از صراحت چون خیری ندیده‌‌بود، کم‌کم به دوپهلونویسی و درازنویسی و لاجرم به مُهمل‌نگاری رو آورد. کلیشه‌نویسی، درازنویسی، بیهوده‌نویسی، و در یک کلام شلخته‌نگاری سال‌هاست که در نوشته‌های ما جا خوش کرده‌است و ظاهرا به این راحتی‌ها بیرون‌رفتنی نیست. شلخته‌نگاری دامنه‌ی بسیار وسیعی دارد و به مطبوعات و رسانه‌های جمعی و حتی کتاب‌های درسی هم سرایت کرده‌است. در این حلقه می‌خواهیم تمرین کنیم که ساده، صریح، موجز، بی‌ابهام و بی‌پیرایه بنویسیم. می‌خواهیم حرمت خودمان، حرمت زبان مادری‌مان، و حرمت مخاطب‌هایمان را پاس بداریم. می‌خواهیم سعی کنیم زبان نوشته‌هایمان تا جای ممکن طبیعی، نزدیک به زبان گفتاری، منسجم و منطقی، و در یک کلام «پاکیزه» باشد. می‌خواهیم فارسی را درست بنویسیم.','2014-09-27 06:16:00','سایت','Ring',6,150000,'Editing.jpg','image/jpeg',95629,'2014-06-10 05:30:59','2014-06-10 05:30:59','2014-09-03 08:09:14'),(9,'فتوشاپ','قوه‌ی خلاقیت خود را رها کنید...','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۳۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','کلمه‌ی «فتوشاپ» دیگر از نام یک نرم‌افزار فراتر رفته‌است و به یک اصطلاح در فرهنگ عامه‌ی مردم تبدیل شده‌است و به هر پدیده‌ای که یا می‌خواهند خلاف واقع جلوه دهند یا خارق‌العاده است می‌گویند «فتوشاپه». در کلاس «آموزش نرم‌افزار فتوشاپ»  که به صورت مقدماتی برگزار می‌شود، از آشنایی اولیه با محیط این برنامه و معرفی ابزار‌ها تا کار با فیلترها و رتوش عکس پوشش داده می‌شود. تمرکز این کلاس، آموزش ابزار‌هایی است که بیش‌ترین کاربرد را دارد تا بتوانید به آسانی کارهای ابتدایی گرافیکی خود را به تنهایی انجام دهید. با توجه به کاربرد بسیار بالای ویرایش عکس، شرکت در این کلاس به دانشجویان مهندسی، دانشجویان غیرمهندسی و  غیردانشجویان کلا توصیه می‌شود.','2014-08-02 11:29:00','سایت','Class',20,450000,'logo-photoshop.png','image/png',220774,'2014-06-12 11:31:16','2014-06-12 11:31:16','2014-07-04 10:21:10'),(10,'طراحی وب - مقدماتی','شروع طراحی وب','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۲۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۳۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۵۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','وب‌سایت شخصی می‌خواهید اما سی‌اس‌اس و جاوااسکریپت بلد نیستید؟ در زبان اچ‌تی‌ام‌ال تازه‌کار هستید؟ دربه‌در دنبال یک طراح وب می‌گردید تا یک کار ساده برایتان انجام دهد؟ پس دست نگه‌ دارید! این حلقه مخصوص شماست. در این حلقه به‌طور مختصر با ابزارهای طراحی وب و  زبان جاوااسکریپت آشنا می‌شوید و احتمالا (اگر اندکی ذوق داشته‌باشید!) می‌توانید در نهایت وب‌سایت شخصی خودتان را طراحی کنید.','2014-07-05 11:42:00','سایت','Ring',40,350000,'HTML5CSS3.jpg','image/jpeg',77452,'2014-06-12 12:05:38','2014-06-12 12:05:38','2014-07-04 10:13:44'),(12,'کارآموزی','کارآموزی','در این پروژه نیاز به کارآموز در سه بخش است. بخش اول: عنوان: شنود کردن ترافیک شبکه برای به‌دست آوردن اطلاعات لازم برای ساختن موتور جستجو (search engine). پیشنیازها: آشنا به زبان جاوا و علاقه‌مند به شبکه. ترجیحا آشنا به شبکه و زبان اسکالا بخش دوم: عنوان: کار با bts برای شنود و نفوذ به شبکه مخابرات پیشنیازها: آشنا به مخابرات و سیگنال و علاقه‌مند به امنیت بخش سوم: شنود شبکه برای به‌دست آوردن اطلاعات امنیتی و جلوگیری از حملات ایترنتی (مثال: botnet detection using clustering & classification)  پیشنیازها: آشنایی با طبقه‌بندی و خوشه‌بندی علاقه‌مند به امنیت و شبکه','در این پروژه نیاز به کارآموز در سه بخش است.  <p> <h4>بخش اول: </h4></p> <p> عنوان: شنود کردن ترافیک شبکه برای به‌دست آوردن اطلاعات لازم برای ساختن موتور جستجو (search engine). </p> <p> پیشنیازها: آشنا به زبان جاوا و علاقه‌مند به شبکه. ترجیحا آشنا به شبکه و زبان اسکالا </p> <p> <h4> بخش دوم: </h4> </p>  <p> عنوان: کار با bts برای شنود و نفوذ به شبکه مخابرات </p> <p> پیشنیازها: آشنا به مخابرات و سیگنال و علاقه‌مند به امنیت </p> <p> <h4> بخش سوم: </h4> </p> <p> عنوان: شنود شبکه برای به‌دست آوردن اطلاعات امنیتی و جلوگیری از حملات ایترنتی (مثال: botnet detection using clustering & classification)</p> <p> پیشنیازها: آشنایی با طبقه‌بندی و خوشه‌بندی علاقه‌مند به امنیت و شبکه </p>','2014-06-16 03:12:00','سایت','Lab',999,0,'Karamoozi.PNG','image/png',13793,'2014-06-19 18:27:34','2014-06-16 03:13:23','2014-06-19 18:27:35'),(13,'آزمایشگاه رباتیک پیشرفته و سیستم‌های هوشمند','بازی‌های کامپیوتری','جایگاه بازی‌های کامپیوتری در دنیای امروز بر هیچ کسی‌ پوشیده نیست، با گسترش و همه‌گیر شدن گوشی‌های تلفن هم‌راه هوشمند که مجهز به سیستم‌عامل‌های قدرتمند هستند بازی‌های کامپیوتری نیز گسترش چشم‌گیری پیدا کرده است. امروز مخاطبان آن فقط نوجوانان نیستند، بلکه افراد با هر سنی‌ و هر شغلی‌ و با هر سطح درآمدی می‌توانند مخاطبان بازی‌های کامپیوتری باشند. با این حال منصفانه نیست که بگوییم بازی‌ها فقط به قصد سرگرمی ساخته می‌شوند، در این دنیای پر هیجان مصارف آموزشی نیز وجود دارد. مطالعات و بررسی‌‌ها نشان داده است که درس دادن به کمک محیط‌های بازی توجه کاربران را بیشتر جلب می‌کند، ترس از یادگیری را از بین می‌برد، انگیزه یادگیری را در آنها افزایش می‌دهد و همچنین یادگیری را ماندگارتر می‌کند. یکی‌ دیگر از گونه‌های نوظهور بازی‌ها، بازی‌های غیرِ جدی (Casual Game) هستند. این بازی‌ها قوانین بسیار ساده‌ای دارند و یادگیری آنها ساده است. به پردازنده‌های قدرتمند نیاز ندارد، در تاکسی و اتوبوس می‌توان به این بازی‌ها پرداخت. ساخت و انتشار این نوع از بازی‌ها معمولا کم‌هزینه است. این بازی‌ها معمولا بر روی کامپیوتر‌های شخصی‌ و با استفاده از مرورگر‌های وب و یا بر روی گوشی‌های تلفن همراه و تبلت‌ها قابل بازی کردن هستند. هدف این بازی‌ها سرگرم کردن همه افراد در هر زمان و هر مکانی است. همین ویژگی‌‌ها باعث شده است که این بازی‌ها در دنیای شلوغ و پر دردسر امروز که افراد وقتی‌ برای تفریح ندارند بتوانند جایگاهی برای  خود پیدا کنند و می‌توان گفت در حالِ حاضر پرطرفدار‌ترین بازی‌های موجود در بازار از این دست بازی‌ها هستند. اگر به طراحی و ساخت این دست از بازی‌ها علاقه دارید میتوانید فعالیت خود را در آزمایشگاه هوش مصنوعی و رباتیک آغاز کنید. این آزمایشگاه در گذشته چند بازی آموزشی طراحی و به بازار عرضه کرده است، و در حال حاضر نیز چند پروژه بازی آموزشی در حال انجام است، اگر علاقه مند باشید می‌توانید به این پروژه‌ها ملحق شوید. همچنین با شکل گیری کلوپ بازی سازی دانشگاه تهران و ارتباط با گرافیست‌ها و هنرمندان از سایر دانشکده‌های دانشگاه تهران، فضا برای فعالیت بیشتر در این زمینه باز شده است و می‌توان این زمینه را به صورت حرفه‌ای‌تر در دانشگاه ادامه داد. دانشجویانی که علاقه‌مند به فعالیت در زمینه‌های مختلف بازی‌سازی (برنامه‌نویسی، طراحی شخصیت، انیمیشن، طراحی محیط و...) در قالب کارآموزی و یا خارج از آن هستند میتوانند با ایمیلsajad.mowlaei@gmail.com   ارتباط برقرار کنند، تا با تخصص‌های لازم در آزمایشگاه، پیش‌نیاز‌های موجود و پروژه‌های جاری بیشتر آشنا شوند.','جایگاه بازی‌های کامپیوتری در دنیای امروز بر هیچ کسی‌ پوشیده نیست، با گسترش و همه‌گیر شدن گوشی‌های تلفن هم‌راه هوشمند که مجهز به سیستم‌عامل‌های قدرتمند هستند بازی‌های کامپیوتری نیز گسترش چشم‌گیری پیدا کرده است. امروز مخاطبان آن فقط نوجوانان نیستند، بلکه افراد با هر سنی‌ و هر شغلی‌ و با هر سطح درآمدی می‌توانند مخاطبان بازی‌های کامپیوتری باشند. با این حال منصفانه نیست که بگوییم بازی‌ها فقط به قصد سرگرمی ساخته می‌شوند، در این دنیای پر هیجان مصارف آموزشی نیز وجود دارد. مطالعات 