ی در آزمایشگاه سیستم‌های هوشمند اطلاعات تحت سرپرستی دکتر شاکری تعریف شده است. کارآموز باید مسلط به زبان جاوا باشد و مهم‌تر از آن باید علاقه‌مند و مستعد بوده که بتواند حتی برخی مسائل پژوهشی را خودش برطرف کند.  در صورتی که نیاز به اطلاعات بیشتری دارید می‌توانید به آزمایشگاه ۳۱۴ ساختمان جدید مراجعه کنید.','یک موقعیت کارآموزی پیرامون پردازش معنایی داده‌های متنی در آزمایشگاه سیستم‌های هوشمند اطلاعات تحت سرپرستی دکتر شاکری تعریف شده است. کارآموز باید مسلط به زبان جاوا باشد و مهم‌تر از آن باید علاقه‌مند و مستعد بوده که بتواند حتی برخی مسائل پژوهشی را خودش برطرف کند.  در صورتی که نیاز به اطلاعات بیشتری دارید می‌توانید به آزمایشگاه ۳۱۴ ساختمان جدید مراجعه کنید.','2014-06-16 03:19:00','سایت','Lab',999,0,'Karamoozi.PNG','image/png',13793,'2014-06-19 18:28:23','2014-06-16 03:20:18','2014-06-19 18:28:23'),(15,'High Performance Computing','محاسبات سریع','منابع محاسباتی و در دسترس بودن آن، جزء لازمی از تحقیق و پژوهش است. پژوهش‌گران همواره از سرویس‌های محاسباتی دانشگاه‌ها و مراکز تحقیقاتی برای رفع نیازهای محاسباتی خود استفاده می‌کنند. متأسفانه در ایران، سیستم متمرکزی که به صورت عمومی سرویس محاسباتی قابل قبول ارائه کنند وجود ندارد. دیده می‌شود که اغلب اساتید و آزمایشگاه‌ها برای تأمین نیازهای محاسباتی خود به خرید سیستم‌های محدود در محیط آزمایشگاه خود بسنده می‌کنند. در حالی که با هزینه‌ی کمتری در مجموع می‌توان سیستم متمرکزی برای تأمین نیازهای تمامی آزمایشگاه‌ها، حداقل در پردیس دانشگاه، ساخت. کاهش زمان اجرا، کاهش توان مصرفی، خنک‌سازی (cooling)، استفاده از تمامی قابلیت‌های منابع سخت‌افزاری (High Throughput Computing)، ارائه‌ی پلت‌فرم‌های موازی برای پردازش سریع (HPC) از مزیت‌های چنین سیستمی است. در گام بعدی، می‌توان آن را به ارائه‌ی این سرویس در سطح کشور گسترش داد. مراکز مختلف مانند پژوهشگاه دانش‌های بنیادی (IPM)، دانشگاه امیرکبیر، و دانشگاه صنعتی اصفهان تلاش‌هایی در این راستا کرده‌اند که یا موفق نبوده‌اند و یا به صورت عمومی جواب‌گوی نیاز پژوهش‌گران کشور نیستند. از نظر ما، اولین گام برای ساخت چنین زیرساختی، یک‌پارچه‌سازی (integration) همین منابع موجود است. با این هدف که با یک‌پارچه‌سازی منابع محاسباتی موجود در کشور و همین‌طور فرصت‌های تعامل با گرید اروپا، منابع موجود به بهترین نحو ممکن بهره‌برداری شوند. <br> فرصت کارآموزی به عنوان بخشی از این پروژه، که یک منبع محاسباتی برای حوزه‌ی بیولوژی محاسباتی و بیوانفورماتیک است، نیاز به طراحی یک زبان با حوزه‌ی خاص (Domain-specific) یا DSL به زبان Scala داریم. این DSL قرار است نیازهای برنامه‌نویسی بیولوژیست‌ها را برآورده و همین‌طور امکان اجرای مقیاس‌پذیر (scalable) برنامه‌های نوشته‌شده با این زبان را فراهم کند. به همین دلیل، با همکاری پژوهشگاه دانش‌های بنیادی (IPM) یا شرکت‌های حامی خواهان جذب کارآموز علاقمند در این زمینه هستیم. در صورت داشتن تخصص یا علاقه با ali.ghaffaari@ipm.ir تماس بگیرید و در صورت داشتن هر گونه سؤالی، از پرسیدن آن دریغ نورزید!','<p> <h4> مقدمه </h4> </p> <p>منابع محاسباتی و در دسترس بودن آن، جزء لازمی از تحقیق و پژوهش است. پژوهش‌گران همواره از سرویس‌های محاسباتی دانشگاه‌ها و مراکز تحقیقاتی برای رفع نیازهای محاسباتی خود استفاده می‌کنند. متأسفانه در ایران، سیستم متمرکزی که به صورت عمومی سرویس محاسباتی قابل قبول ارائه کنند وجود ندارد. دیده می‌شود که اغلب اساتید و آزمایشگاه‌ها برای تأمین نیازهای محاسباتی خود به خرید سیستم‌های محدود در محیط آزمایشگاه خود بسنده می‌کنند. در حالی که با هزینه‌ی کمتری در مجموع می‌توان سیستم متمرکزی برای تأمین نیازهای تمامی آزمایشگاه‌ها، حداقل در پردیس دانشگاه، ساخت. کاهش زمان اجرا، کاهش توان مصرفی، خنک‌سازی (cooling)، استفاده از تمامی قابلیت‌های منابع سخت‌افزاری (High Throughput Computing)، ارائه‌ی پلت‌فرم‌های موازی برای پردازش سریع (HPC) از مزیت‌های چنین سیستمی است. در گام بعدی، می‌توان آن را به ارائه‌ی این سرویس در سطح کشور گسترش داد. مراکز مختلف مانند پژوهشگاه دانش‌های بنیادی (IPM)، دانشگاه امیرکبیر، و دانشگاه صنعتی اصفهان تلاش‌هایی در این راستا کرده‌اند که یا موفق نبوده‌اند و یا به صورت عمومی جواب‌گوی نیاز پژوهش‌گران کشور نیستند. از نظر ما، اولین گام برای ساخت چنین زیرساختی، یک‌پارچه‌سازی (integration) همین منابع موجود است. با این هدف که با یک‌پارچه‌سازی منابع محاسباتی موجود در کشور و همین‌طور فرصت‌های تعامل با گرید اروپا، منابع موجود به بهترین نحو ممکن بهره‌برداری شوند. </p> <p> <h4> فرصت کارآموزی </h4> </p> <p>  به عنوان بخشی از این پروژه، که یک منبع محاسباتی برای حوزه‌ی بیولوژی محاسباتی و بیوانفورماتیک است، نیاز به طراحی یک زبان با حوزه‌ی خاص (Domain-specific) یا DSL به زبان Scala داریم. این DSL قرار است نیازهای برنامه‌نویسی بیولوژیست‌ها را برآورده و همین‌طور امکان اجرای مقیاس‌پذیر (scalable) برنامه‌های نوشته‌شده با این زبان را فراهم کند. به همین دلیل، با همکاری پژوهشگاه دانش‌های بنیادی (IPM) یا شرکت‌های حامی خواهان جذب کارآموز علاقمند در این زمینه هستیم. در صورت داشتن تخصص یا علاقه با ali.ghaffaari@ipm.ir تماس بگیرید و در صورت داشتن هر گونه سؤالی، از پرسیدن آن دریغ نورزید! </p>','2014-06-16 03:21:00','سایت','Lab',999,0,'hpc-future-trends.jpg','image/jpeg',493574,'2014-06-19 08:36:20','2014-06-16 03:23:42','2014-06-19 08:37:10'),(16,'سایت دانشکده‌ی برق و کامپیوتر','کارآموزی','دانشکده مهندسی برق و کامپیوتر در تابستان ۱۳۹۳، تعدادی کارآموز جهت مرکز کامپیوتر دانشکده از بین دانشجویان این دانشکده پذیرش می‌نماید. لذا از علاقه‌مندان درخواست می‌نماید رزومه خود را به آدرس info@ece.ut.a.c.ir ارسال نمایند.','دانشکده مهندسی برق و کامپیوتر در تابستان ۱۳۹۳، تعدادی کارآموز جهت مرکز کامپیوتر دانشکده از بین دانشجویان این دانشکده پذیرش می‌نماید. لذا از علاقه‌مندان درخواست می‌نماید رزومه خود را به آدرس info@ece.ut.a.c.ir ارسال نمایند.','2014-06-16 03:25:00','سایت','Lab',999,0,'_logo.png','image/png',20933,'2014-06-19 08:30:13','2014-06-16 03:26:41','2014-06-19 08:30:14'),(17,'آزمایشگاه سیستم‌های بی‌درنگ اتکاپذیر','کارآموزی','<p> حداکثر ۲ نفر کارآموز برای تابستان ۱۳۹۳ </p> <p> زمینه‌ها: سیستم‌عامل بی‌درنگ، الگوریتم‌های زمان‌بندی، سیستم‌عامل‌ نهفته، به‌کارگیری از برخی شبیه‌ساز‌ها، برنامه‌نویس اپلیکیشن‌های خاص‌منظوره </p> <p> پیش‌نیاز: معماری کامپیوتر، سیستم‌عامل، (optional) طراحی الگوریتم و شبیه‌سازی</p>','<p> حداکثر ۲ نفر کارآموز برای تابستان ۱۳۹۳ </p> <p> زمینه‌ها: سیستم‌عامل بی‌درنگ، الگوریتم‌های زمان‌بندی، سیستم‌عامل‌ نهفته، به‌کارگیری از برخی شبیه‌ساز‌ها، برنامه‌نویس اپلیکیشن‌های خاص‌منظوره </p> <p> پیش‌نیاز: معماری کامپیوتر، سیستم‌عامل، (optional) طراحی الگوریتم و شبیه‌سازی</p>','2014-06-16 03:27:00','سایت','Lab',999,0,'Karamoozi.PNG','image/png',13793,'2014-06-19 18:28:30','2014-06-16 03:33:30','2014-06-19 18:28:30'),(18,'General Game Playing','عامل هوشمند، واقعا هوشمند','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۲۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>',' تا حالا برای مسابقه‌های هوش‌مصنوعی عامل هوش‌مند طراحی کردین؟ برای کدوم مسابقه؟ مثلا شطرنج؟ عامل شما می‌تونست در مسابقه دوز هم بازی کنه؟ دوز که خیلی ساده‌تره که! می‌خوایم یک عامل هوشمند طراحی کنیم که توانایی شرکت توی همه‌ی بازی‌های مختلف رو داشته باشه، یعنی قوانین بازی رو بفهمه، استراتژی بچینه و برنده بشه، تنهای تنها.','2014-07-08 08:56:00','سایت','Ring',20,150000,'ggp.jpeg','image/jpeg',133272,'2014-06-19 09:00:32','2014-06-19 09:00:32','2014-07-06 20:44:49'),(19,'کارآموزی','پردازش متن طبیعی','<p> برای کارآموزی در آزمایشگاه پردازش متن و زبان طبیعی موضوعات زیر مطرح هستند که دانشجویان می توانند روی آنها کار کنند</p>\r\n<p> -   ارائه الگوریتم هوشمند جهت محاسبه شباهت معنایی بین دو جمله زبان فارسی و انگلیسی</p>\r\n<p> -   پیاده سازی الگوریتم تشخیص مهمترین افراد تاثیرگذار در شبکه های اجتماعی بزرگ</p>\r\n<p> -   پیاده سازی ابزاری جهت نمایش ساختمان داده درخت </p>\r\n <p> -   پیاده سازی سیستم هوشمند محاسبه احتمال حضور یک جمله در زبان انگلیسی یا فارسی به زبان C++</p>\r\n <p> -   ارائه یک الگوریتم مترجم هوشمند متون انگلیسی به فارسی با روش dynamic programming</p>\r\n<p> -   ارائه سیستمی text 2 speech برای یک جمله انگلیسی </p>','<p> برای کارآموزی در آزمایشگاه پردازش متن و زبان طبیعی موضوعات زیر مطرح هستند که دانشجویان می توانند روی آنها کار کنند</p>\r\n<p> -   ارائه الگوریتم هوشمند جهت محاسبه شباهت معنایی بین دو جمله زبان فارسی و انگلیسی</p>\r\n<p> -   پیاده سازی الگوریتم تشخیص مهمترین افراد تاثیرگذار در شبکه های اجتماعی بزرگ</p>\r\n<p> -   پیاده سازی ابزاری جهت نمایش ساختمان داده درخت </p>\r\n <p> -   پیاده سازی سیستم هوشمند محاسبه احتمال حضور یک جمله در زبان انگلیسی یا فارسی به زبان C++</p>\r\n <p> -   ارائه یک الگوریتم مترجم هوشمند متون انگلیسی به فارسی با روش dynamic programming</p>\r\n<p> -   ارائه سیستمی text 2 speech برای یک جمله انگلیسی </p>','2014-06-19 09:02:00','سایت','Lab',999,0,'Karamoozi.PNG','image/png',13793,'2014-06-19 18:28:38','2014-06-19 09:07:29','2014-06-19 18:28:38'),(20,'آشنایی با اصول مارکتینگ','آیا محصولی که بر اساس ایده‌ی قوی و با تکنولوژی فنی عالی تولیدشده باشد قطعا به فروش خواهدرفت؟','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۳۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۵۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n<p>دوره در ۱۰ جلسه برگزار می‌شود. زمان برگزاری کلاس نیز روزهای شنبه ساعت ۱۷:۳۰ است. </p>','<p> آیا شما هم جزو آن دسته از مهندسینی هستید که قصد دارید در آینده یک کسب‌وکار راه‌اندازی کنید و با تولید ایده‌های‌تان درآمد کسب کنید؟ آن دسته از کارآفرینان آینده که در نظر دارید یک محصول خیلی خوب تولید کنید و فکر می‌کنید به‌محض ورود محصول خارق‌العاده‌ی شما به بازار درآمد بسیار زیادی کسب خواهید نمود؟ </p>\r\n\r\n<p> تاریخ بارها شکست محصولات فنی قوی را به نمایش گذاشته و موجب تعجب مدیران، کارآفرینان و مهندسینی که با دیدی مشابه شما تلاش به عرضه محصول به بازار نموده‌اند شده‌است. دلیل این اتفاق جامع در چه چیزی نهفته است؟ </p>\r\n\r\n<p> در این دوره سعی می‌کنیم علاقه‌مندان را با مفاهیم فروش و مارکتینگ آشنا و در راستای توسعه‌ی دید کارآفرینان و مدیران آینده تلاش کنیم. </p>\r\n\r\n<p> چنانچه به موضوعاتی از این دست علاقه دارید و علل موفقیت محصولاتی که به نظر فنی شما خیلی ویژه نبوده‌اند و یا شکست محصولاتی که از نظر تولیدکننده بسیار کارا بوده‌اند، برای شما جذابیت دارد در این دوره شرکت نمایید. </p>\r\n','2014-08-07 09:11:00','سایت','Class',30,400000,'marketing.jpg','image/jpeg',11425,'2014-06-19 11:52:09','2014-06-19 09:12:59','2014-07-25 08:57:02'),(21,'Transactional Analysis','دوره‌ی تحلیل رفتار متقابل','هزینه‌ی شرکت در دوره: ۱۳۰ هزارتومان','<p>تحلیل رفتار متقابل یک تئوری روان‌شناسی است که توسط دکتر اریک برن در سال ۱۹۵۰ میلادی ارائه شد و به لحاظ کاربرد آن در حل مشکلات احساسی و رفتاری، مورد قبول جامعه‌ی روان‌شناسی قرار گرفت و به‌تدریج در زمینه‌های مشاوره، روان‌کاوی، گروه‌درمانی، مدیریت، جامعه‌شناسی، توسعه‌ی سازمانی و آموزش، نظریه‌های جدیدی ارائه نمود و گسترش پیدا کرد. این دوره در تمام نقاط جهان به‌عنوان یک مسیر خودشناسی و آشنایی با روان‌شناسی تجربی برای همه‌ی سطوح جامعه برگزار می‌شود. در دوره‌ی تحلیل رفتار متقابل ما با دلیل عکس‌العمل‌ها و رفتارهای خود در طول شبانه‌روز آشنا می‌شویم و با آشنا شدن هر چه بیش‌تر با احوالات و آموختن نوع بیان، ابراز احساس و افکار خویش٬ قدم تازه‌ای برای درک درون خود و کنترل آن‌ برمی‌داریم. با این روش می‌توان روشن كرد كه در لایه‌های زیرین ارتباطات جاری بین انسان‌ها به‌واقع چه چیزی در حال رخ دادن است.\r\n</p>\r\n\r\n<p> <strong>\r\nقبل از شروع کلاس تحلیل روابط متقابل، یک جلسه‌ی معارفه در تاریخ ۲۵ تیر برگزار خواهدشد. حضور در جلسه‌ی معارفه برای تمام عزیزانی که قصد شرکت در کلاس را دارند، اجباری است. پس از حضور در این جلسه‌، در صورت عدم تمایل می‌توانید ثبت‌نام خود را لغو کنید.\r\n</strong>\r\n</p>\r\n\r\n<p>\r\nاین دوره در قالب کارگاه‌های تئوری و عملی برگزار می‌شود و شامل ۱۲ جلسه‌ی سه‌ساعته در ۱۲ هفته‌ی متوالی است.\r\n</p>\r\n\r\n','2014-08-06 09:15:00','سایت','Class',40,1300000,'ta.jpg','image/jpeg',38373,'2014-06-19 09:17:04','2014-06-19 09:17:04','2014-07-19 14:07:48'),(22,'جاوای پیشرفته (اندروید)','زبان شی‌گرای سازمانی','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۳۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','زبان جاوا یکی از پرکاربرد‌ترین زبان‌های سطح بالا است که در پروژه‌های بزرگ زیادی به کار رفته است و در حال حاضر زبان پایه‌ی برنامه‌های مبتنی بر سیستم‌عامل اندروید است. در این کلاس با مروری سریع بر مقدمات این زبان، تکنیک‌ها و الگو‌های متداولی که بر این زبان حاکم است مورد بحث قرار گرفته می‌شود. مطالب این کلاس، دانش ابتدایی مورد نیاز برنامه‌نویسی اندروید را پوشش می‌دهد. \r\nهم‌چنین شرکت‌کنندگان در این کلاس باید قبلا جاوا کار کرده باشند.\r\nلازم به‌ذکر است که این کلاس پیش‌نیاز کارگاه آموزشی اندروید است که به‌زودی توسط شاخه‌ی دانشجویی ای‌سی‌ام  برگزار می‌شود.','2014-07-12 04:01:00','سایت','Class',40,450000,'java-logo.jpg','image/jpeg',37158,'2014-06-19 19:04:18','2014-06-19 19:04:18','2014-07-12 08:23:59'),(23,'جاوا','آموزش کار با جاوا برای مبتدیان','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۳۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','<p>شروع برنامه‌نویسی به زبان جاوا برای مبتدیان</p>\r\n<p>\r\nجاوا معروف‌ترین و پر استفاده‌ترین زبان برنامه‌نویسی است! از جاوا به طور خاص بیش از هر زبان دیگری برای Enterprise Applications استفاده می‌شود.\r\nاین زبان با ماشین مجازی‌اش قادر به اجرا شدن روی هر ماشینی بدون وابستگی به سیستم‌عامل آن ماشین است!\r\nهدف این کلاس دانشجویانی‌است که با زبان C++ آشنایی دارند و قصد یادگیری زبان جاوا را دارند است.\r\n</p>','2014-08-09 05:00:00','سایت','Class',50,450000,'java-logo.jpg','image/jpeg',37158,'2014-07-09 10:09:02','2014-07-09 10:09:03','2014-08-01 12:27:07'),(24,'اندروید','نوشتن برنامه‌ی موبایل را از همین الان شروع کنید','<p>\r\nپیش‌نیاز شرکت در این ورک‌شاپ، تسلط نسبی به زبان جاوا است. برای یادگیری زبان جاوا می‌توانید در کلاس‌های \r\n<a href=\"http://acm.ut.ac.ir/events/events/23\"> جاوای مقدماتی </a>\r\nیا \r\n<a href=\"http://acm.ut.ac.ir/events/events/22\"> جاوای پیشرفته (اندروید) </a>\r\nثبت نام کنید.\r\n</p>\r\n<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی مهندسی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۷۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۲۲۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table> \r\n\r\n<p> \r\nناهار و پذیرایی در طول ۳ روز ورک‌شاپ به‌عهده‌ی شاخه‌ی دانشجویی ای‌سی‌ام است. هم‌چنین دانشجویان دانشکده‌ی مهندسی برق و کامپیوتر دانشگاه تهران می‌توانند در روز شروع ورک‌شاپ با مراجعه به دفتر باقی پول خود را دریافت کنن.\r\n<p>','در یک کارسوق (ورک‌شاپ) سه‌روزه یاد بگیرید چگونه برنامه‌ی اندروید بنویسید.\r\n','2014-08-27 04:36:00','سایت','Workshop',50,2250000,'android.png','image/png',51173,'2014-07-13 05:48:11','2014-07-13 05:48:12','2014-08-27 17:22:18'),(25,'مجله‌ی اف‌یک','توزیع شماره‌ی جدید مجله‌ی اف‌یک','<div style=\"font-size: 28px\">\r\n<p>\r\nشما می‌توانید نسخه‌ی جدید مجله را با ۵۰ درصد تخفیف و به قیمت ۲۰۰۰ تومان پیش‌خرید کنید و در مراسم رونمایی تحویل بگیرید.\r\n\r\n</p>\r\n\r\n</div>','<p>\r\nاز همان روزی که چاپ روزنامه و نشریات کاغذی رایج شد تا امروز که بیش‌تر مقالات و اخبار به‌صورت الکترونیکی منتشر می‌شود، هر رسانه‌ای که از تکرار فاصله نگیرد و ایده‌ای نو نداشته‌باشد، مخاطبان خود را از دست می‌دهد. از این‌رو بر آن شدیم تا تحولاتی در جهت بهبود نشریه داشته‌باشیم؛ تغییراتی که از دو شماره‌ی قبل با تغییر در شیوه‌ی نگارش و در شماره‌ی قبل با تغییراتی ظاهری در صفحه‌آرایی آغاز شد و با ورود اف‌یک به دهه‌ی دوم انتشار خود، در این شماره با تغییراتی در ساختار مطالب ادامه یافت.\r\n</p>\r\n<p> \r\nشاید مشخص‌ترین تغییر انتخاب یک موضوع تخصصی برای هر فصل است که سهم بیش‌تری از مطالب هر شماره به آن اختصاص می‌یابد. انتخاب «موضوع فصل» این امکان را فراهم می‌کند تا با موضوعاتی که کم‌تر به آن‌ها توجه شده‌است بیش‌تر آشنا شویم.  این فصل موضوع «بازی‌سازی» را انتخاب کردیم. موضوعی که با وجود اهمیت زیاد، در ایران و به‌ویژه در دانشگاه تهران کمتر مورد توجه قرار گرفته‌است. معرفی کوتاه از بازی‌سازی، گفت‌وگو با رییس هیات مدیره‌ی بنیاد ملی بازی‌‌های رایانه‌ای (دکتر مینایی) و مقالات تخصصی از مواردی است که در این شماره خواهید خواند.\r\n</p> \r\n<p>\r\nاخبار دانشکده، مروری بر رویداد‌های مهم فصل، بررسی جشنواره‌ی مهندسی اینترنت، مقاله‌ی «ردپای ما در اینترنت»، تغییرات رشته‌ی مهندسی کامپیوتر به قلم دکتر کارگهی از دیگر مطالبی است که در این شماره خواهید خواند.\r\nشماره‌ی یازدهم اف‌یک در روز یکشنبه نوزدهم مردادماه منتشر خواهد شد. در این روز در دانشکده‌ی مهندسی برق و کامپیوتر منتظر حضورتان هستیم.\r\n</p>','2014-08-10 00:30:00','سایت','F1',999,20000,'F1-poster-11-3.jpg','image/jpeg',109547,'2014-08-05 17:04:13','2014-08-05 17:04:14','2014-08-06 17:23:27'),(26,'جذب نیرو در گروه ارزش‌آفرین شریف','جذب نیرو در گروه ارزش‌آفرین شریف','<p>\r\nاگر در هر یک از زمینه های زیر علاقمند به همکاری هستید، با ما تماس بگیرید و به جمع ما بپیوندید.\r\n<ul>\r\n<li>\r\nمدیریت و امنیت شبکه\r\n</li>\r\n<li>\r\nبرنامه نویسی به زبان Python\r\n</li>\r\n<li>\r\nسابقه مفید در کار کردن با Wordpress\r\n</li>\r\n</ul>\r\n</p>\r\n<p>\r\nمزایا و شرایط  کار کردن در این پروژه :\r\n\r\n<ul>\r\n<li>\r\nهمکاری بصورت پاره وقت یا تمام وقت\r\n</li>\r\n<li>\r\nتجربه کاری مفید\r\n</li>\r\n<li>\r\nحقوق بالا\r\n</li>\r\n<li>\r\nمحیط کاری مناسب با سطح علمی بالا\r\n</li>\r\n</p>\r\n\r\n<h3>\r\nایمیل: job@sharifin.com\r\n</h3>\r\n<br>\r\n<h3>\r\nشماره‌ی تماس: 09122044682\r\n</h3>','<p>\r\nگروه ارزش آفرین شریف مفتخر خواهد بود برای همکاری در پروژه ای منحصر به فرد و با ابعاد گسترده از خلاقیت، دانش و توان فنی شما نیز بهره مند گردد.\r\n</p>','2014-09-26 17:53:00','Site','Lab',50,0,'Screenshot_from_2014-09-22_21_34_02.png','image/png',50596,'2014-09-22 18:06:13','2014-09-22 18:04:06','2014-09-22 18:06:13'),(27,'کارگاه آموزشی دو روزه‌ی PsychToolBox','کارگاه آموزشی دو روزه‌ی PsychToolBox','<p>\r\n<h4>\r\n در ابتدای دوره زبان برنامه نویسی متلب آموزش داده می شود.\r\n</h4>\r\n<h3>\r\nبرای ثبت‌نام در کارگاه آموزشی می‌توانید از \r\n<a href=\"http://acm.ut.ac.ir/psychtoolbox\">\r\nاین‌جا \r\n</a>\r\nاقدام کنید.\r\n</h3>\r\n<p>\r\nزمان برگزاری: چهارشنبه ۹۳/۷/۲۳ ساعت ۱۴ تا ۱۸\r\n<br/>\r\nپنج‌شنبه ۹۳/۷/۲۵ ساعت ۹ تا ۱۲ و ۱۴ تا ۱۸\r\n<br/>\r\nمکان برگزاری: امیرآباد - دانشکده‌ی فنی دانشگاه تهران - دانشکده‌ی برق و کامپیوتر\r\nمحل دقیق برگزاری متعاقبا به اطلاع شرکت‌کنندگان خواهد رسید.\r\n</p>','<p>\r\nآموزش گام به گام به همراه طراحی یک آزمایش سایکوفیزیک\r\n</p>\r\n<p>\r\nبا همکاری ستاد توسع علوم و فناوری های شناختی، گروه هوش ماشین و رباتیک و شاخه دانشجویی ACM دانشکده فنی دانشگاه تهران.\r\n</p>\r\n','2014-10-15 09:55:00','Site','Workshop',100,0,'Setad.logo.jpg','image/jpeg',11464,'2014-09-24 10:12:08','2014-09-24 10:12:08','2014-10-04 11:39:25'),(28,'همایش جامع جاوا‌اسکرپیت','همایش جامع جاوا‌اسکرپیت','<p>در این همایش با متدها، تکنولوژی‌ها و فریم‌ورک‌های جدید در زمینه‌ی جاوا اسکریپت آشنا خواهیدشد که به شما این امکان را می‌دهد تا بتوانید زمینه‌ی فعالیت خود را بهتر انتخاب کنید. بدیهی است هدف تنها ارتقا و به‌روزرسانی سطح علمی کسانی است که علاقه دارند تا با ویژگی‌های جدید برنامه‌نویسی و همچنین استفاده از فریم‌ورک‌های این زبان آشنا شوند . محور‌های آموزشی این همایش به شرح زیر است :‌</p>\r\n					\r\n					<div class=\"row\">\r\n						<div class=\"col-md-6\">\r\n							<ul>\r\n								<li>دام ( مدل شی گرایی سند )‌ ( DOM  )</li>	\r\n								<li>کامپایلر </li>	\r\n								<li>ساخت اپلیکیشن (Application Architecture &amp; Desing Pattern)</li>	\r\n								<li>کار با فایل های صوتی</li>	\r\n								<li>کار با فایل های ویدیویی</li>	\r\n								<li>سمت سرور (Nodejs, Socket.io, Offline, Comm)</li>	\r\n								<li>موتور ( جستجو - محاسبه - پیش پردازشگر ها - بازی ) </li>	\r\n							</ul>\r\n						</div>\r\n						<div class=\"col-md-6\">\r\n							<ul>\r\n								<li>الگو</li>	\r\n								<li>ساخت بازی دو بعدی و سه بعدی</li>	\r\n								<li>طراحی ( نمودار - اجسام سه بعدی - چارت ها - المان های وب )</li>	\r\n								<li>اپلیکیشن‌های هایبریدی</li>	\r\n								<li>خطایابی </li>	\r\n								<li>ابزار توسعه</li>	\r\n							</ul>\r\n						</div>\r\n					</div>','<p>\r\nجاوا اسکریپت یکی از قدرتمندترین زبان‌های برنامه‌نویسی و هم‌چنان در حال رشد و توسعه است. از این‌رو گروه آموزشی بوت‌ویک با هم‌کاری انجمن علمی مهندسی کامپیوتر دانشگاه تهران در اقدامی بی‌سابقه با جمع‌آوری مطالب و متد‌های روز دنیا قصد دارند تا طی همایشی جامع، این مطالب را به علاقه‌مندان ارائه کنند.\r\n</p>\r\n\r\n<p>\r\nبرای اطلاعات بیش‌تر و ثبت‌نام می‌توانید به سایت \r\n<a href=\"http://www.tehranconf.com\"> همایش جامع جاوا‌اسکریپت</a>\r\nمراجعه کنید.\r\n\r\n</p>','2014-10-15 11:16:00','Site','Workshop',999,0,'IMG_0849.JPG','image/jpeg',988943,'2014-10-01 05:13:01','2014-09-27 11:20:29','2014-10-01 05:13:04'),(29,'فارسی‌نویسی به‌کمک صفحه‌کلید استاندارد فارسی','فارسی‌نویسی به‌کمک صفحه‌کلید استاندارد فارسی','<p>\r\n نکات مورد بحث در این سمینار دقیقا «الفبا»ست. اگر نوشتن روی کاغذ نیازمند دانستن الفبای نگارش است، برای نوشتن در کامپیوتر و برای وب باید چند نکته‌ی فنی را هم بر آن الفبای نخستین اضافه کنید؛ در غیر این صورت، فرد بی‌سوادی محسوب می‌شوید.\r\n</p>','<p>\r\nهنوز هستند خیلی‌ها که مقدماتی‌ترین الفبای فنی نگارش در کامپیوتر و برای وب را یا نمی‌دانند، یا می‌دانند و رعایت نمی‌کنند. این سمینار بدون وارد شدن به موضوع رسم‌الخط و ویرایش، الفبای فنی فارسی‌نویسی در کامپیوتر و برای وب را به شما می‌آموزد.\r\n</p>','2014-10-01 11:25:00','Site','Workshop',40,0,'Seminar_-_2.jpg','image/jpeg',40117,'2014-09-27 23:29:04','2014-09-27 23:29:04','2014-10-01 06:08:50'),(30,'شناخت توانایی‌ها برای دانشجویان','برای پیشرفت باید نقاط ضعف را از بین برد یا توانایی‌ها را افزایش داد؟','آزمون:  \r\n\r\nدر زمینه خودشناسی آزمون‌های مختلفی وجود دارد. شاید از معروف‌ترین و همه‌گیرترین آزمون‌ها که در ایران هم شناخته‌شده هستند بتوان به DISC ، MBTIو MMPI اشاره کرد. در کنار این آزمون‌ها، آزمون شناخت توانایی‌ها (Strengths Finder) هم وجود دارد که در طول سال‌های گذشته بخش مهمی از دوره‌های شناخت توانایی‌ها بوده‌است. این آزمون براساس تحقیق موسسه گالوپ شکل گرفته‌است و تم‌های توانایی هر فرد را در غالب ٣۴ تم معرفی می‌کند. تفاوت این آزمون نسبت به دیگر آزمون‌ها این است که برمبنای رویکرد روان‌شناسی مثبت‌گرا تهیه شده و بیشتر تمرکز آن برشناخت نقاط قوت و استعدادها است. این آزمون کمک می‌کند تا بتوانید درک بهتری از قابلیت‌های خود داشته‌باشید و دلیل بسیاری از رفتارها و احساس‌های تکراری در طول زندگی را دریابید.\r\n<br><br>\r\n \r\n\r\n<b>این دوره شامل چهار جلسه‌ است که در هر جلسه برای درک مفاهیم از بازی‌ها و فعالیت‌های فردی و گروهی استفاده خواهدشد. قبل از شروع دوره نیز، یک همایش آشنایی در تاریخ ۴ آذر ماه ساعت ۱۲ برگزار خواهدشد. حضور در همایش معارفه برای تمام عزیزانی که قصد شرکت در کلاس را دارند، اجباری است.</b>\r\n<br><br>\r\n \r\n* ثبت‌نام دوره پس از همایش یادشده شروع می‌شود.<br>\r\n* آزمون شناخت توانایی‌ها به‌صورت اینترنتی گرفته می‌شود. <br>\r\n* این دوره شامل ۴ جلسه سه‌ساعته است. <br>\r\n* هزینه‌ی شرکت در دوره: ۷۰ هزارتومان<br>\r\n<br>\r\n<br>\r\nثبت‌نام تا روز سه‌شنبه ۱۱ آذر ادامه دارد.\r\n<br>\r\nکلاس در صورت رسیدن به حدنصاب تشکیل می‌شود.','ممکن است شما رشته‌ی تحصیلی خود را از روی علاقه انتخاب نکرده‌باشید. شاید هم با آگاهی کامل رشته و مسیر تحصیلی خود را انتخاب کرده‌باشید. در هر شرایط شما نیاز دارید تا در شروع، اهدافی متناسب با قابلیت‌های خود انتخاب کنید. ما در انجام فعالیت‌هایی برای رسیدن به اهدافی که متناسب با استعدادها و توانایی‌های‌مان تعریف شده‌اند عملکردی یکتا و بی‌نظیر خواهیم‌داشت و به دستاوردهای بزرگی می‌رسیم. شناخت توانایی‌های فردی به شما کمک می‌کند تا مسیر شغلی خود را متناسب با استعدادها و توانایی‌های‌تان انتخاب کنید و اهدافی متناسب با قابلیت‌های خود تعریف نمایید. \r\n\r\nمهم نیست که در زندگی چه نقشی دارید. مهم نیست که در کجای دنیا ایستاده‌اید. شما می‌توانید و قابلیت این را دارید که دنیا را با خود همراه کنید و شرایط را آن‌طور که می‌خواهید بسازید. شناخت توانایی‌ها به شما کمک می‌کند چون شما همواره در جست‌وجوی بهبود، رشد و تعالی هستید. شناخت توانایی‌ها به شما کمک می‌کند چون به چگونه بودن خود اهمیت می‌دهید و می‌خواهید نقش تاثیرگذار خود در زندگی را بیابید. شناخت توانایی‌ها به شما کمک می‌کند چون می‌خواهید روزهای زندگی را عادی سپری نکنید چرا که می‌دانید بزرگ‌ترین خیانت انسان به خودش این است که خودش را کشف نکند، قابلیت‌هایش را نشناسد و براساس آن‌ها زندگی نکند. شناخت توانایی‌ها به شما روی‌کرد و تفکری را می‌دهد که بتوانید همواره در مسیر رشد باقی بمانید. ','2014-12-09 08:30:00','Site','Workshop',200,700000,'web-super.jpg','image/jpeg',372954,'2014-11-25 17:20:53','2014-11-17 07:14:28','2014-12-02 17:06:21'),(31,'اولین ایده بازار تخصصی مهندسی پزشکی','اولین ایده بازار تخصصی مهندسی پزشکی','ایده‌ی شما می‌ تواند طراحی و ساخت یک وسیله‌ی ساده و کاربردی در مهندسی پزشکی باشد و یا نوشتن یک نرم‌‌افزار کاربردی موبایل که نیازی را در این زمینه برطرف کند.\r\nبعد کافی‌ست کمی دقیق‌تر به دوستان خود نگاه کنید و ببینید کدام یک مهارتی دارند تا شما را در به‌ثمر رسیدن ایده‌ی خود یاری کنند. ایده‌ی خود را با آن‌ها کامل کنید و برای کسب حمایت‌های مادی و معنوی و شروع کسب‌وکار خلاقانه‌ی خود آن را با ما درمیان بگذارید.\r\n<br><br>\r\nنفر اول: ۵ میلیون ریال\r\n<br>\r\nحمایت ۵۰ میلیون ریالی به صورت بلاعوض از ۳ ایده‌ی اول\r\n<br>\r\n(در قالب حمایت از طرح های مرکز ایده‌پردازی، نوآوری و فناوری اداره کل انجمن های علمی دانشگاه امیرکبیر)\r\n<br>\r\nتقدیر و ارائه پوستر از ۱۰ ایده‌ی برتر در رویداد «ایده بازار»\r\n<br><br>\r\nمهلت ارسال ایده تا ۱۴ آذرماه\r\n<br>\r\nزمان رویداد ۷ام آذرماه\r\n<br><br>\r\nاین برنامه با همکاری انجمن‌های علمی مهندسی پزشکی دانشگاه امیرکبیر، مهندسی پزشکی و مهندسی کامپیوتر دانشگاه تهران برگزار می‌شود.\r\n','هر ایده یک اتفاق ساده و ناگهانی در ذهن شماست که در هر مکانی ممکن است بیافتد، وسط کلاس درس، کنار تخت بیمار، توی مترو، پشت فرمان ماشین و یا وقتی در پارکی شروع به دویدن می‌کنید. فقط کافی‌ست این اتفاق‌ها را کمی جدی بگیرید و به سادگی از کنارشان عبور نکنید.','2014-12-17 08:30:00','Site','Conference',200,0,'b06635332ce3c557fd2d0701e075f0796be2a5953bcdf54d0b7c7b1dccfb8ed5.jpg','image/jpeg',248738,'2014-11-25 17:22:12','2014-11-25 17:22:12','2014-11-25 17:22:12'),(32,'کارگاه آموزشی جامع جاوااسکریپت','کارگاه آموزشی جامع جاوااسکریپت','موضوعات این کارگاه عبارت است از:\r\n<br><br>​​\r\n1. Introduction to Javascript (data types, expressions, operators, objects, arrays, functions, ...)\r\n<br>\r\n2. Client side libraries (jQuery, Angular.js)\r\n<br>\r\n3. Server side platform: Node.js, Socket.io\r\n<br>','جاوا اسکریپت یکی از قدرتمندترین زبان‌های برنامه‌نویسی و هم‌چنان در حال رشد و توسعه است. از این‌رو شاخه‌ی دانش‌جویی اِی‌سی‌اِم کارگاه آموزشی جاوااسکرپیت را برگزار می‌کند.','2014-12-17 08:30:00','Site','Workshop',999,200000,'JS.jpg','image/jpeg',307088,'2014-12-10 08:16:41','2014-11-30 16:25:37','2014-12-14 17:16:20'),(33,'حلقه‌ی مهندسی نرم‌افزار-طراحی تحت وب','حلقه‌ی مهندسی نرم‌افزار-طراحی تحت وب',' به دانش‌جویان علاقه‌مند به همکاری در پروژه‌ی «انتخاب واحد مجازی» و دانشجویان ورودی ۹۲ توصیه می‌شود در این حلقه شرکت کنند.','در این حلقه قصد داریم با استفاده از مفاهیم اولیه‌ی مهندسی نرم‌افزار، چند پروژه‌ی تحت وب را از طراحی اولیه، تا پیاده‌سازی نهایی و آمایش جلو ببریم. از نکات مثبت این حلقه، می‌توان به تمرین عملی مفاهیم مهندسی نرم‌افزار مانند «امکان‌سنجی»، «مورد کاربردی»، «Class Diagram» و هم‌چنین آموزش زبان Ruby و فریم‌ورک Ruby On Rails نام برد. مهم‌تر از همه در کنار آموزش و تمرین مفاهیم، خروجی این حلقه ۳ پروژه‌ی اجرایی خواهدبود که به مرحله‌ی اجرا خواهد رسید. ','2014-12-23 08:30:00','Site','Ring',25,250000,'ruby_on_rails_web_version.jpg','image/jpeg',743340,'2014-12-18 20:09:10','2014-12-15 09:08:15','2014-12-18 20:09:12'),(34,'گذری بر نظیریابی در داده‌های بزرگ','گذری بر نظیریابی در داده‌های بزرگ','در این گفتار، فرآیند نظیریابی داده‌ها (Data Matching)، یکی از فرآیندهای مهم در سامانه‌های تجمیع، درچهارچوب پردازش داده‌های بزرگ، مورد بررسی اجمالی قرار می‌گیرد. هدف از نظیریابی، یافتن اقلام داده‌ای یکسان در پایگاه‌های گوناگون است. به‌عنوان مثال، چنین سامانه‌ای باید قادر به تشخیص یکسان بودن دو رکورد (محمد رضا لطفی، نوازنده تار) و (م. ر. لطفی، تارنواز) باشد. در ادامه، مراحل مختلف این فرآیند، چالش‌های پیش رو، و برخی راه‌حل‌های پیشنهادشده مورد اشاره قرار خواهند گرفت.\r\n<br>\r\nشنبه ۶/۱۰/۹۳ ساعت ۱۲:۳۰ تا ۱۳:۳۰ کلاس ۸۰۳ طبقه هشتم ساختمان جدید دانشکده‌ی مهندسی برق و کامپیوتر',' روزی روزگاری: عمده‌ی داده‌های دنیا، ساخت‌یافته بودند. مدل‌های گوناگون پایگاهی، از سلسله‌مراتبی و شبکه‌ای تا مدل رابطه‌ای، برای مدیریت و استخراج اطلاعات ابداع شده و مورد بهره‌برداری قرار گرفته‌اند. در سال‌ها و دهه‌های اخیر، اما، عمده‌ی داده‌های تولیدشده، خصوصا در فضای وب، غیرساخت‌یافته و نیمه‌ساخت‌یافته هستند. داده‌های مربوط به موضوعات یکسان یا مرتبط، در قالب‌های متفاوت و گوناگونی عرضه می‌شوند (مانند صفحات HTML و متون زبان طبیعی)، و حاوی مقادیر قابل ملاحظه‌ای نویز هستند. از همین رو، تجمیع این داده‌ها در قالب یک مدل داده‌ای یکپارچه ، از جهت ارتقاء کیفیت داده‌ها، مدیریت حجم آنها و امکان اعمال روش‌های گوناگون استخراج اطلاعات و دانش، حائز اهمیت است. روش‌های نوین تجمیع داده‌ها (Data Integration) باید امکان یکنواخت‌سازی حجم بسیار زیادی از داده‌ها را با کیفیت بالا، در زمان قابل‌قبول و باکمترین میزان دخالت عامل انسانی فراهم آورند.','2014-12-27 09:00:00','Site','Talk',200,NULL,'adel.png','image/png',573019,'2014-12-25 18:06:56','2014-12-25 06:04:32','2014-12-25 18:06:57'),(35,'Bitcoin & Deep Learning two icons of Data-Driven era','Bitcoin & Deep Learning two icons of Data-Driven era','Virtual currencies such as Bitcoin or Litecoin are the only viable solutions to develop micro-transaction economy that provide incentives for people to sell their data while protecting their privacy. At the same time with the explosion of data and high complexity of models, deep learning is the top candidate to make it possible to mine big data and use them for decision-making, medical diagnosis, behavioral analysis, crisis management and many other data driven industries.\r\n<br>\r\n یکشنبه ۱۲:۳۰ تا ۱۳:۳۰ آمفی‌تئاتر دانشکده‌ی مهندسی برق و کامپیوتر','There is a strong trend in different Industries to rely on data than experts & intuition for major policy making decisions. Ad-Revenue model has played a major role for the birth of big data in these industries. However this model is neither sustainable nor scalable. High cost of transactions in conventional currencies is the major deterrent to developing alternative business models.','2014-12-28 09:00:00','Site','Talk',200,NULL,'anghezi2.png','image/png',508942,'2014-12-25 09:31:05','2014-12-25 09:12:38','2014-12-25 09:31:06'),(36,'On Streaming and Communication Complexity of the Set Cover Problem','On Streaming and Communication Complexity of the Set Cover Problem','Our approach uses randomization, which we show is necessary: no deterministic constant approximation is possible (even given exponential time) using $o(m n)$ space. These results are some of the first on streaming algorithms and efficient two-party communication protocols for approximation algorithms. Moreover, we show that our algorithm can be applied to multi-party communication model.\r\n<br>\r\nدوشنبه ۱۳ تا ۱۴ آمفی‌تئاتر دانشکده‌ی مهندسی برق و کامپیوتر','We develop the first streaming algorithm and the first two-part communication protocol that uses a constant number of passes/rounds and sublinear space/communication for logarithmic approximation to the classic \\prob{Set Cover} problem. Specifically, for $n$ elements and $m$ sets, our algorithm/protocol achieves a space bound of $O(m \\cdot n^\\delta \\log^2 n \\log m)$(for any $\\delta > 0$) using $O(4^{1/\\delta})$ passes/rounds while achieving an approximation factor of $O(4^{1/\\delta} \\log n)$ in polynomial time. If we allow the algorithm/protocol to spend exponential time per pass/round, we achieve an approximation factor of $O(4^{1/\\delta})$.','2014-12-29 09:30:00','Site','Talk',200,NULL,'anghezi.png','image/png',616300,'2014-12-25 09:30:49','2014-12-25 09:14:37','2014-12-25 09:30:50'),(37,'GPU Programming','GPU Programming','','در این گفت‌وگو قصد داریم تا با بررسی مسائل زیر، نگاهی کوتاه به برنامه‌نویسی هم‌روند بر روی GPU داشته‌باشیم:<br>\r\n– ساختار (SIMD (Single Instruction, Multiple Data،<br>\r\n– برنامه‌های قابل محاسبه با استفاده از SIMD،<br>\r\n– معرفی چارچوب و مدل برنامه‌نویسی (CUDA(Compute Unified Device Architecture،<br>\r\n– معرفی پروژه‌ی درس تحقیق در عملیات که با استفاده از CUDA پیاده‌سازی شده‌است.<br>','2015-02-07 09:00:00','Site','Ring',200,0,'GPU_Programming.jpg','image/jpeg',98688,'2015-01-31 20:15:28','2015-01-31 20:15:29','2015-01-31 20:24:53');
